description:
My Screensaver Maker is the easiest and most powerful tool which lets you make your own slideshow screensaver, flash screensaver, video screensaver or website screensaver in minutes. You also can share your screensaver with your frields by create a single .exe screensaver installer. All is easy, get and make your own screensaver now!!! 

Make picture to be slideshow screensaver,
flash files(*.exe,*.swf) to be a screensaver, 
website to be a screensaver,
video(*.avi,*.mpeg,*.asf,*.wmv) to be a screensaver

Make single compressed self installing Screen Saver setup file

Create single stand-alone screen saver file(.SCR) and can be set in the Control Panel.

